import React from 'react'
import AppBar from 'material-ui/AppBar';

//
// COMPONENT
//

let Header = () => {
    return (
		<AppBar
	        title='Redux Twitter Trends'
	        iconClassNameRight='muidocs-icon-navigation-expand-more'
	    />
	)
}

//
// EXPORT
//

export default Header
